import UserContext from "../Utils/Contexts/UserContext";

import logo from "../img/micronote.png"
import "./Sidebar.css";

const Sidebar = () => {

    return (
        <UserContext.Consumer>
            {(data) => {
                return(
                    <div id="sidebar-contents">

                        <div id="logo">
                            <img src={logo} alt="" />
                            <h1>micronote</h1>
                            <h3>mee 𐤟 cro 𐤟 no 𐤟 tay</h3>
                        </div>

                        <div className="info">
                            <h4>{data}</h4>
                        </div>

                    </div>
                )
            }}
        </UserContext.Consumer>
    )
}

export default Sidebar;
